from typing import List
from collections import Counter
import math

class Solution:

    def maximumLength(self, nums: List[int]) -> int:    

        d = {}
        for i in sorted(nums,reverse=True):
            if i**2 in d and i != 1 and i in d:
                d[i] = d[i**2] + 2
            else:
                d[i] = 1

        d_1 = nums.count(1)
        d[1] = (d_1 if d_1 % 2 else d_1 - 1)

        return max(d.values())

